package _567

import (
	"leetcode/501_1000/551_600/567/one"
	"leetcode/501_1000/551_600/567/two"
	"testing"

	"github.com/stretchr/testify/require"
)

func TestCheckInclusion(t *testing.T) {
	require.NotEmpty(t, one.CheckInclusion("ab", "eidbaooo"))
	require.NotEmpty(t, one.CheckInclusion("abc", "bbbca"))
	require.NotEmpty(
		t,
		one.CheckInclusion(
			"vxqakfyaqahufxfizupjrkkifjlbfqfeprqrfjvxnubntdtlvz",
			"",
		),
	)

	require.NotEmpty(t, two.CheckInclusion("ab", "eidbaooo"))
	require.NotEmpty(t, two.CheckInclusion("abc", "bbbca"))
	require.NotEmpty(
		t,
		two.CheckInclusion(
			"vxqakfyaqahufxfizupjrkkifjlbfqfeprqrfjvxnubntdtlvz",
			"",
		),
	)
}
